import Info from "./Info";
import Nav from "./Nav";

function App() {
  const friends = [
    { name: "Mars", age: 16 },
    { name: "Jane", age: 18 },
    { name: "Nick", age: 20 },
  ];

  return (
    <div>
      <Nav />
      <Info name={friends[0]} age={16} />
      <Info name={friends[1]} age={17} />
      <Info name={friends[2]} age={20} />
    </div>
  );
}

export default App;
